import React from 'react';
import net_movie from "../images/net_movie.png"

const Portfolio = () => {
    return (
        <div className="portfolio">
            <p>Hello world</p>
            <div><img src={net_movie} alt="picture_portfolio" /></div>
            <div><img src="" alt="picture portfolio" /></div>
            <div><img src="" alt="picture portfolio" /></div>
            <div><img src="" alt="picture portfolio" /></div>
            <div><img src="" alt="picture portfolio" /></div>
            <div><img src="" alt="picture portfolio" /></div>

        </div>
    );
};

export default Portfolio;
